import Layout from '../common/Layout';
//axios로 데이터를 불러오려면 UseEffect로 의존성 배열을 비워놓은 다음에 해당 컴포넌트가 처음 마운터 되는 순간 한 번만 데이터를 불러오도록 처리를 해야 함
import axios from 'axios';
import { useEffect, UseEffect } from 'react';

function Member() {
	useEffect(() => {
		fetch(process.env.PUBLIC_URL + '/DB/members.json')
			.then((data) => data.json()) //여기까지 하고 데이터를 다음번을 통해서 데이터를 받아옴
			.then((json) => console.log(json));
	}, []);
	return (
		<Layout name={'Members'}>
			<p>members</p>
		</Layout>
	);
}

export default Member;
